INSERT INTO `z_business` (`id`, `compa_infor`, `name_company`, `userID`) VALUES
(1, 'Trường Đại học Bách khoa Hà Nội (tên tiếng Anh\r\nHanoi university of science and technology – viết tắt HUST)\r\nđược thành lập theo Nghị định số 147/NĐ ngày\r\n6-3-1956 do Bộ trưởng Bộ Giáo dục Nguyễn Văn Huyên ký.\r\nĐây là trường đại học kỹ thuật đầu tiên của nước ta\r\ncó nhiệm vụ đào tạo kỹ sư công nghiệp cho công cuộc\r\nxây dựng CNXH ở miền Bắc và đấu tranh giải phóng miền Nam;\r\nlà trung tâm đào tạo, nghiên cứu khoa học và công nghệ đa ngành,\r\nđa lĩnh vực; kết hợp chặt chẽ giữa đào tạo với nghiên cứu\r\nkhoa học nhằm tạo nguồn nhân lực chất lượng cao\r\nvà bồi dưỡng nhân tài khoa học, công nghệ; định hướng phát triển\r\nthành đại học nghiên cứu ngang tầm với các đại học\r\ncó uy tín trong khu vực và trên thế giới.', 'SITE', 1),
(2, 'Triển khai đề án: “Quy hoạch tổng thể xây dựng và phát triển trường Đại học Bách Khoa Hà Nội giai đoạn 2006 – 2030”, với mục tiêu phấn đấu” Xây dựng ĐHBK Hà Nội thành Trường đại học nghiên cứu trọng điểm quốc gia về khoa học & công nghệ, đào tạo đa ngành, đa lĩnh vực, đạt trình độ và chất lượng khu vực và thế giới; là địa chỉ tin cậy, hấp dẫn đối với xã hội và các nhà đầu tư phát triển công nghệ, giới doanh nghiệp, tài chính trong và ngoài nước”, được sự đồng ý của Bộ Giáo dục và Đào tạo ngày 24/03/2008 trường ĐHBK Hà Nội đã công bố thành lập công ty cổ phần Đầu tư và Phát triển công nghệ Bách Khoa Hà Nội (BK-Holdings). Đây là mô hình doanh nghiệp lần đầu tiên được phép thành lập tại một trường Đại học ở Việt Nam.', 'VUNA2', 4),
(3, 'Năm 1998, Trung tâm Sản xuất sạch Việt Nam (VNCPC) được thành lập theo khuôn khổ dự án US/VIE/96/063 do Chính phủ Thụy Sĩ (thông qua Cục Kinh tế Liên bang Thụy Sĩ – SECO) tài trợ. Dự án này do Tổ chức Phát triển Liên hợp quốc (UNIDO) điều hành và Trường Đại học Bách Khoa (trực tiếp là Viện Khoa học và Công nghệ Môi trường) thực hiện.\r\nMục tiêu hoạt động cốt yếu của VNCPC lúc đó là phổ biến rộng rãi khái niệm Sản xuất sạch hơn (SXSH) và xúc tiến việc áp dụng tiếp cận chủ động phòng ngừa ô nhiễm này vào các doanh nghiệp công nghiệp ở Việt Nam. ', 'Doanh Nghiep', 32),
(4, 'ds', 'TA12', 33),
(5, '212', 'ưq', 34),
